:11:18','2015-10-15 07:11:18',31),(32,'Why is the middle of America (for example Panama) a separate region on the map. I was surprised to see it in the results and then realized it was still marked on the map although I excluded North and South America.','2015-10-15 07:11:42','2015-10-15 07:13:06',32),(33,NULL,'2015-10-15 07:13:23','2015-10-15 07:13:23',33),(34,'Even though I allowed for very expensive trips, the recommendations are all quite cheap. That is fine in this case, but makes me wonder, whether I am missing out on something I could afford.','2015-10-15 07:13:43','2015-10-15 07:16:45',34),(35,NULL,'2015-10-15 07:22:55','2015-10-15 07:22:55',35),(36,NULL,'2015-10-15 07:34:19','2015-10-15 07:34:19',36),(37,NULL,'2015-10-15 07:34:38','2015-10-15 07:34:38',37),(38,NULL,'2015-10-15 07:38:33','2015-10-15 07:38:33',38),(39,NULL,'2015-10-15 07:38:49','2015-10-15 07:38:49',39),(40,NULL,'2015-10-15 07:41:38','2015-10-15 07:41:38',40),(41,'No matter which query I post for the North-America and EU region, only a small portion of the results is EU related.','2015-10-15 07:44:28','2015-10-15 07:46:24',41),(42,'Nice tool, would love to see it in real-world scenario. Flight costs should be included, though (500 EUR for 1 week in California is far too optimistic)\r\n\r\nBest,\r\nChristoph','2015-10-15 07:55:34','2015-10-15 07:59:19',42),(43,NULL,'2015-10-15 08:45:08','2015-10-15 08:45:08',43),(44,NULL,'2015-10-15 08:46:00','2015-10-15 08:46:00',44),(45,NULL,'2015-10-15 08:47:03','2015-10-15 08:47:03',45),(46,NULL,'2015-10-15 08:47:49','2015-10-15 08:47:49',46),(47,NULL,'2015-10-15 08:48:38','2015-10-15 08:48:38',47),(48,'Ich habe den Eindruck, dass die Reisezeit etwas stärker gewichtet werden könnte','2015-10-15 08:53:27','2015-10-15 08:54:08',48),(49,NULL,'2015-10-15 08:54:24','2015-10-15 08:54:24',49),(50,NULL,'2015-10-15 08:55:24','2015-10-15 08:55:24',50),(51,NULL,'2015-10-15 09:01:39','2015-10-15 09:01:39',51),(52,NULL,'2015-10-15 09:01:58','2015-10-15 09:01:58',52),(53,'Bei geringem Budget werden evtl. die Tage etwas zu sehr gekürzt, anstelle dass billigere Regionen ganz oben erscheinen','2015-10-15 09:02:07','2015-10-15 09:02:52',53),(54,NULL,'2015-10-15 09:04:03','2015-10-15 09:04:03',54),(55,NULL,'2015-10-15 09:04:59','2015-10-15 09:04:59',55),(56,NULL,'2015-10-15 09:05:37','2015-10-15 09:05:37',56),(57,NULL,'2015-10-15 09:06:49','2015-10-15 09:06:49',57),(58,'Ein wichtiges Kriterium bei der Reiseplanung wäre für mich noch die Sicherheit des Landes.','2015-10-15 09:28:23','2015-10-15 09:30:22',58),(59,'The staytime sometimes should be better balanced (e.g., a 45 days trip with staytimes of 18 days - 4 days - 23 days seems a bit too unbalanced -> it\'s not always clear why one part is way shorter than the others).','2015-10-15 12:57:38','2015-10-15 13:01:39',59),(60,NULL,'2015-10-15 13:01:54','2015-10-15 13:01:54',60),(61,'I like most of the recommendations. For future work, I would suggest explanations for each part of the recommendation. E.g., \"20 days of Italy and Malta because you like Architecture and Beach\"','2015-10-15 13:02:10','2015-10-15 13:04:27',61),(62,NULL,'2015-10-15 14:47:46','2015-10-15 14:47:46',62),(63,NULL,'2015-10-15 14:48:13','2015-10-15 14:48:13',63),(64,NULL,'2015-10-15 16:35:47','2015-10-15 16:35:47',64),(65,NULL,'2015-10-16 06:15:27','2015-10-16 06:15:27',65),(66,NULL,'2015-10-16 06:59:47','2015-10-16 06:59:47',66),(67,NULL,'2015-10-16 07:00:53','2015-10-16 07:00:53',67),(68,NULL,'2015-10-16 07:35:26','2015-10-16 07:35:26',68),(69,NULL,'2015-10-16 09:31:29','2015-10-16 09:31:29',69),(70,'I like the recommended trips. I like Trip 1 most, USA Midwest & USA Mid-Atlantic. Many thanks!','2015-10-16 09:34:07','2015-10-16 09:37:31',70),(71,NULL,'2015-10-16 09:59:02','2015-10-16 09:59:02',71),(72,NULL,'2015-10-16 10:00:05','2015-10-16 10:00:05',72),(73,NULL,'2015-10-16 10:19:45','2015-10-16 10:19:45',73),(74,'Da ich eine längere Reise plane sind die aufgegebenen Optionen sehr gut. sie zeigen entweder zb Californien auf, wo ich ganze 30 Tage verbringen kann oder zB ein Trip in der Karibik mit mehreren Zielen. Sehr gut!','2015-10-16 12:43:22','2015-10-16 12:45:51',74),(75,NULL,'2015-10-16 12:46:30','2015-10-16 12:46:30',75),(76,'zum Wandern + Wintersport würde ich Trip 2 bevorzugen, da hier mehrere Orte während meiner 30 Tage aufgezeigt werden. Während meines Urlaubs würde ich somit viel kennenlernen und nicht nur einen Ort. Gute Auswahl an Optionen in meinen angeklickten Wunschorten.','2015-10-16 12:46:35','2015-10-16 12:48:54',76),(77,'Ich bevorzuge Trip 2, da ich 45 Tage Zeit zum reisen bekomme. Hier möchte ich gerne mehrere Orte sehen. Hier zum Beispiel Neuseeland und Australien Süd + West. Gefällt mir sehr gut! Der Preis ist auch sehr gerechtfertigt.','2015-10-16 12:49:42','2015-10-16 12:51:36',77),(78,NULL,'2015-10-16 12:52:24','2015-10-16 12:52:24',78),(79,'Ich kann mir vorstellen Trip 2 - 4 anzutreten. alle sind sehr vielfältig und ich werde viele Orte sehen. Müsste ich genau einen direkt wählen, dann wäre es Trip 4 mit Bali und den Philippinen. Der Preis ist absolut gerechtfertigt und unterschreitet mein Budget sogar um einiges. Perfekt!!!','2015-10-16 12:52:38','2015-10-16 12:54:46',79),(80,NULL,'2015-10-16 12:56:02','2015-10-16 12:56:02',80),(81,'Trip 3 würde ich wählen um meinen Wintersport Urlaub über die Weihnachtszeit zu genießen. Sehr gerne würde ich die 4 angegebenen Orte sehen. Dass ich pro Ort 5 Tage Zeit habe ich perfekt und absolut ausreichend denke ich. Die Zeit wird super genutzt!','2015-10-16 12:56:25','2015-10-16 12:58:11',81),(82,NULL,'2015-10-16 13:33:04','2015-10-16 13:33:04',82),(83,NULL,'2015-10-16 13:34:36','2015-10-16 13:34:36',83),(84,NULL,'2015-10-16 13:36:17','2015-10-16 13:36:17',84),(85,NULL,'2015-10-16 13:42:51','2015-10-16 13:42:51',85),(86,NULL,'2015-10-16 13:44:10','2015-10-16 13:44:10',86),(87,NULL,'2015-10-16 13:48:06','2015-10-16 13:48:06',87),(88,NULL,'2015-10-16 13:59:13','2015-10-16 13:59:13',88),(89,NULL,'2015-10-17 06:22:00','2015-10-17 06:22:00',89),(90,NULL,'2015-10-17 15:31:41','2015-10-17 15:31:41',90),(91,'The prices seem far too low. ','2015-10-17 15:31:51','2015-10-17 15:34:55',91),(92,NULL,'2015-10-19 16:56:34','2015-10-19 16:56:34',92),(93,'Trip 3 doesn\'t meet my expectations of cities and architecture verry well.\r\nOne day in Qatar and Bahrain on Trip 5 seems to be too short.','2015-10-19 17:00:53','2015-10-19 17:06:33',93),(94,'A lot of USA','2015-10-19 17:07:37','2015-10-19 17:15:10',94),(95,NULL,'2015-10-19 17:15:50','2015-10-19 17:15:50',95),(96,NULL,'2015-10-19 17:16:03','2015-10-19 17:16:03',96),(97,'','2015-10-19 17:16:08','2015-10-19 17:20:40',97),(98,NULL,'2015-10-21 06:29:48','2015-10-21 06:29:48',98),(99,NULL,'2015-10-21 19:55:01','2015-10-21 19:55:01',99),(100,'A 4-5 day trip as recommendation for a longer holiday wouldn\'t really meet the user expectations. \r\nOne reason probably that I can only specify the max length not the min length. \r\nBut all recommendations are more of the same. Short break, flying halfway around the world. \r\n\r\nNot every possible combination (4 days for 500 euros in Papua new guinea) does make sense.\r\nFirst I might not want to spend the most time out of 4 days on the plane.\r\nSecond I might easily find a longer vacation for the same amount if I don\'t travel so far away. So I would have more of my vacation time and hence a much better value for money. ','2015-10-21 19:58:01','2015-10-21 20:10:37',100),(101,NULL,'2015-10-21 20:11:04','2015-10-21 20:11:04',101),(102,NULL,'2015-10-21 20:11:25','2015-10-21 20:11:25',102),(103,NULL,'2015-10-21 20:11:47','2015-10-21 20:11:47',103),(104,NULL,'2015-10-21 20:12:09','2015-10-21 20:12:09',104),(105,NULL,'2015-10-21 20:12:19','2015-10-21 20:12:19',105),(106,'I don\'t get any recommendations within Europe - whether I enable or disable all preferences. \r\nSparse data problem? ','2015-10-21 20:12:37','2015-10-21 20:13:42',106),(107,NULL,'2015-10-23 07:35:06','2015-10-23 07:35:06',107),(108